import React from 'react';
import '../index.css';
import PostsBlog from '../Components/PostsBlog';

function Blog(){

    const [posts, setPosts] = React.useState([]);

    React.useEffect(() =>{
        fetch('http://localhost:3000/Posts.json')
        .then((resp) => resp.json())
        .then( (json) => {
            setPosts(json.posts);
        })
    }, []);
    return(
        <div>
            <PostsBlog items = {posts}/>
        </div>
    );
}


export default Blog;
